import logo from "./logo.svg";
import "./App.css";

const App = () => {
  return (
    <div>
      <div>
        <Header />
      </div>
      <div className="App">
        <ul>
          <li>HTML</li>
          <li>CSS</li>
          <li>JS</li>
          <li>REACT</li>
        </ul>
      </div>
    </div>
  );
};

const Header = () => {
  return (
    <div>
      <a href="#">Home</a>
      <a href="#">News Feed</a>
      <a href="#">Messages </a>
    </div>
  );
};

export default App;
